function parseDate(dateAsString, format) {
    const regex = format.toLocaleLowerCase()
    .replace(/\bd+\b/, '(?<day>\\d+)')
    .replace(/\bm+\b/, '(?<month>\\d+)')
    .replace(/\by+\b/, '(?<year>\\d+)')

    const parts = new RegExp(regex).exec(dateAsString) || {};
    const {year, month, day} = parts.group || {};

    return parts.length === 4 ? new Date(year, month - 1, day) : undefined;
}

export default parseDate;
